  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The ImmPort system serves as a long-term,
  sustainable archive of immunology research data generated by investigators mainly
  funded through the NIAID/DAIT. The core component of the ImmPort system is an extensive
  data warehouse containing an integration of experimental data and clinical trial
  data. The ImmPort system also provides data analysis tools and an immunology-focused
  ontology. The analytical tools created and integrated as part of the ImmPort system
  are available to any researcher within ImmPort after registration and approval by
  DAIT. Additionally, the data provided mainly by NIAID/DAIT funded researchers in
  ImmPort will be available to all registered users after the appropriate embargo
  time.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
